    return async (dispatch) => {
        try{
            dispatch({
                type: type.ADD_PRODUCT
            })
            // Api call
            for(let par of Items.entries()){
                ItemsFiltered = par
            }
            console.log(ItemsFiltered)
             await axios.get("/sanctum/csrf-cookie")
            const res = await axios.post('/addproduct',{Items})
        } catch(error){
            if(error){
                console.log(error)
            }

        }

    }   

}
